<html>
<head>
<title></title>
<meta http-equiv="Content-Type" content="text/html; charset=UTF-8">
<script>
function navigate(e) {
    var keynum = (window.event) // IE
        ? e.keyCode
        : e.which;
    if (keynum == 8) {
        window.location = "02c" + ".html";
        return false;
    }
    if (keynum == 13 || keynum == 32) {
        window.location = "02e" + ".html";
        return false;
    }
    if (keynum == 73 || keynum == 105) {
        window.location = "index.html";
        return false;
    }
    return true;
}
</script>
</head>
<body onkeydown="return navigate(event)">
<div style="border-style: solid ; border-width: 2px ; font-size: x-large">
<pre>



                          What's the OpenAPI Spec?

     * Formerly known as Swagger
     * The company maintaining Swagger donated the spec to the
        OpenAPI Initiative: https://openapis.org/
     * You describe your API with a JSON or YAML document












</pre>
</div>
<br>
<div style="font-size: small">
<p></p>
</div>
</body>
</html>
